import { Navigate } from "react-router-dom";
import { useState } from "react";

const Redirect = () => {

  const [link, setLink] = useState("/en")

  if (localStorage.getItem("lang") === null){
    setLink("/en")
  } else {
    setLink(`/${localStorage.getItem("lang")}`)
  }

  return (
    <Navigate to={link}/>
  )
}

export default Redirect
